function noise(context, image, colorHex) {
    corHex = colorHex.replace('#', '');

                //Converto a cor em hexadecimal para decimal
                var colorDecRed = parseInt(corHex.substring(0,2), 16),
                colorDecGreen = parseInt(corHex.substring(2,4), 16),
                colorDecBlue = parseInt(corHex.substring(4,6), 16);
                
                p1 = 1;
                p2 = 1;
                p3 = 1;
                er = eg = eb = 0;

                var imgd = context.getImageData(0, 0, image.width, image.height);
                var data = imgd.data;
                         
                    for (var i = 0, n = data.length; i < n; i += 4) {
                    
                     if(colorDecRed == data[i] && colorDecGreen == data[i+1] && colorDecBlue == data[i+2]){
                          // generating random <span class="jct088" id="jct088_11">color</span> coefficients
                          var randColor1 = 0.6 + Math.random() * 0.4;
                          var randColor2 = 0.6 + Math.random() * 0.4;
                          var randColor3 = 0.6 + Math.random() * 0.4;
                           
                          // assigning random colors to our data
                          data[i] = data[i]*p2*randColor1+er; // red
                          data[i+1] = data[i+1]*p2*randColor2+eg; // green
                          data[i+2] = data[i+2]*p3*randColor3+eb; // blue
                    }
                  }
                  context.putImageData(imgd, 0, 0);
}

